import React from 'react';
import '../App.css'
import Profile from '.'

const ProfileReview = ({ profileReviews, books }) =>
    <div className="profile" >
    {(profileReviews || []).map(x =>
        <Profile 
         key ={x.objectId}
        profile={x}
        />
    )}
    {(books || []).map(x =>
        <Reviews 
         key ={x.objectId}
        book={x}
        />
    )}
</div>

  export default ProfileReview;
